// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

interface IInstantWallet {
    struct wallets {
        string _name;
        address[] _list;
        uint256[] _percent;
        bool _status;
        uint256 _total;
    }
    struct Transaction {
        address _from;
        address _to;
        string _side;
        uint256 _amount;
    }

    function getWallet() external returns (wallets memory);

    function getTransactionsCount() external returns (uint256);

    function getTransactions() external returns (Transaction[] memory);

    function stop() external;

    function start() external;

    function getStopStatus() external returns (bool);

    function Initialize(
        address[] memory _walletlist,
        uint256[] memory _percent,
        string memory _name,
        address _owner
    ) external; 
}
